import React from 'react';
//import logo from './logo.svg';
import Header from './components/Header'
import Widget from './components/Widget'
import Body from './components/Body'

const options = {
    title: {
        text: 'My chart'
    },
    series: [{
        name: 'Profits',
        data: [1, 2, 3]
    }]
}


function App() {
    return (
        <div className="App">
            <Header />
            <Body>
                <Widget data={options} />
            </Body>
        </div>
    );
}

export default App;
